import React, { useState }  from 'react';


const PedidoListRow = ({pedido}) => {

  const [exibirPedido, setExibirPedido] = useState(false)

  let detalhamentoDoPedido = <tr><td>{props.descricao}</td><td>{props.status}</td></tr>;

  const _handleClick = event => {
    event.preventDefault()
    setExibirPedido(!exibirPedido)
  }

  return(
    <tr>
      <td>{pedido.id}</td>
      <td>{pedido.nome}</td>
      {detalhamentoDoPedido}
    </tr>
  );
};

export default PedidoListRow;
